import { useState } from "react";
import { LIGHTNING_EMPEROR } from "../ spec/LightningEmperor-spec";
import BasicForm from "../base/Form";
import React from "react";
const LightningEmperor = () => {
  const { FIRE_BALEYAR } = LIGHTNING_EMPEROR;
  const { HP, ATK, DEF, SPD, CRI_RATE, CRI_DMG } = FIRE_BALEYAR;
  const [form, setForm] = useState({
    defaultHp: 0,
    addHP0: 0,
    addHp1: 0,
    addHp2: 0,
    expectHp: 0,
    defaultAtk: 0,
    addAtk0: 0,
    addAtk1: 0,
    addAtk2: 0,
    expectAtk: 0,
    defaultDef: 0,
    addDef0: 0,
    addDef1: 0,
    addDef2: 0,
    expectDef: 0,
    defaultSpd: 0,
    addSpd: 0,
    expectSpd: 0,
    defaultCriRate: 0,
    addCriRate: 0,
    expectCriRate: 0,
    defaultCriDmg: 0,
    addCriDmg: 0,
    expectCriDmg: 0
  });
  const updateField = e => {
    console.log("e.target", e, e.target);
    setForm(
      {
        ...form,
        [e.target.id]: e.target.value
      },
      console.log("실행되네")
    );
  };
  return (
    <div>
      <p>(baleygr)불뇌제 스펙스펙</p>
      <BasicForm
        defaultHp={HP}
        defaultAtk={ATK}
        defaultDef={DEF}
        defaultSpd={SPD}
        defaultCriRate={CRI_RATE}
        defaultCriDmg={CRI_DMG}
        onChange={updateField}
      />
    </div>
  );
};

export default LightningEmperor;
